text:
Schwing' deine Flügel über meinem Haupte;
                                       Geh' über meine Lippen zu mir ein;
                                       Und die des Myrtenkranzes lang Beraubte
                                       Laß früchtespendend seine Träg'rin sein!

Mir wachsen an den Schultern schon die Flügel;
                                       Ich steig' in der Erhebung schwanken Bügel;
                                       Mein Sehnen wird durch Mutterlust gestillt.

Fortwährend steh' ich jedem zu Gebot;
                                       Doch echolos verhallt' an mir der Ruf
                                       Des Wünschenden.

Erneuter Kampf nach kaum geschloss'nem Frieden;
                                       Ständiges Zagen und Schweben
                                       Zwischen zunächst und soeben;
                                       Wetterfahne im Alle
                                       Bis zu dem endlichen Falle;
                                       Zifferblatt wallenden Zeitstroms;
                                       Meister nur selten des Leitstroms;
                                       Auge, bedecket mit Flören;
                                       Ohr, nur den Stundruf zu hören;
                                       Freier Wille, gehemmet;
                                       Reißender Fluß, doch gedämmet;
                                       Stoff, in das Unabänderliche sich zu schicken,
                                       Stets doch Veränd'rung an ihm selbst zu blicken!

–
                                       Nehmt gleich ein Pflaster, um es aufzulegen;
                                       Dann ist der Eiterplatz vollauf bedeckt.

Kein frisches Korn mehr sieht dem Werk man an;
                                       Das fremde Schrot nur macht sich unkrautsbreit:
                                       Von falscher Münzung lieget das nicht weit.

Ein jeder Mensch ist einer Insel gleich;
                                       Ihm steht der Weg in's Innere nur offen;
                                       Ein Robinson ist er in dem Bereich.

Am Ende hängt's nicht ab von Büchereigenschaften;
                                       An mir nur liegt's, wenn ich so trübe schau':
                                       An mir blieb Unlust und Verzweiflung haften;
                                       Drum seh' ich alles grau in grau.

Macht heute noch die letzte Schichte fest;
                                       Dann steht das Haus; und gut ist ruh'n
                                       Nach vieler Tage mühevollem Thun.

Vor dem Erscheinen ist mir nicht mehr bang':
                                       Heut' war er da zur Kurzweil, zum Bescheide;
                                       Ein andermal kommt er zum Seelenfang.

–
                                       Wohl ehrt es, eine Stellung trefflich zu bekleiden;
                                       Doch eitel heißt, wer die Gewandung pflegt.

Elektrisch Licht, es ist kein Ungeheuer,
                                       Kein blitzesprühend Höllenthier voll Mord;
                                       Das Telephon wirkt sanft von Ort zu Ort;
                                       Kein Donner hallt an ihm als Ruhescheuer.

Was dir von ihr verblieb, wird dann mir nicht entgehen;
                                       Denn Seelen sind aus untheilbaren Massen,
                                       Die niemals von einander lassen.

Das ist das Loos, das allgemeine;
Den Einen nimmt man höher, als er steht,
Dieweil der Bess're für den Schlechtern geht.

Ich kam, weil ihr es eben mir erlaubt,
Weil sicher ich euch hier allein geglaubt;
Und finde euch vom Bösen schon umstricket.

Mein Sohn verwechsle niemals die Geschlechter,
Nicht im Verkehr, nicht in der Grammatik;
Sonst wirst im ganzen Leben du nicht flügg'!

In den Schatten stößt du mich zurücke;
                                       Und doch lebt' ich im schönen Wahn,
                                       Die holde Blüthezeit fing' für mich an.

Der Vater ward geduldet nur als Mann;
                                       Und dünkte er der Hausfrau für zu schlecht,
                                       Verstoßen ward er unerbittlich dann.

Seht, unser Recht datiert aus weiter Ferne,
Als man dem Triebe der Natur noch folgte gerne;
Nicht erst von heut' ist uns're Forderung.

Wir wollen es gebrauchen lernen:
                                       Das Schicksal liest man aus den Sternen;
                                       Der Stachel giebt dem Renner Schwung.

Die Universitäten steh'n uns offen;
Die Fakultäten sind gewillter uns als je;
Und wird von uns auch wen'ger Bier ge – trunken
Als vom Studenten, labt uns doch der Thee.

Ich trat ihn nieder wettergleich,
                                       Obwohl es mir nur wenig nutzte;
                                       Er ist nicht g'rade windelweich.

Hier ist noch niemals Bier geflossen:
Wir sind im Abstinentenhaus;
Das schließt die Spirituosen aus.

Allein ihr bringt mich nicht in Schwung,
                                       Mit euch vermag man nur zu fluchen;
                                       Ihr gebt ja nicht Genugthuung.

Packt doch das Uebel bei der Wurzel an;
                                       So ist schon für die Heilung viel gethan:
                                       Ihr streikt!

Das Licht des Tags getraut sich kaum,
                                       In's Zauberding hineinzudringen;
                                       Es droht die Strahlen zu verschlingen.

–
                                       Die spricht ja noch dem Alter Hohn;
                                       Der sitzet noch kein Mehl im Haare.

Die Burschen schieben Sie zur Mündung;
                                       Dann überfließet Sie ein Wein- und Wasserlauf;
                                       Der giebt den Formen volle Ründung
                                       Und spült die Falten all' hinweg.

Denn in Wirklichkeit
                                       Sollst alles das du bald besitzen;
                                       Du brauchst nur mit dem Aug' zu blitzen.

–
                                       Da naht der Schwindler sich in scheuem Gange;
                                       Er werde tüchtig heimgeschickt.

Ich löse nicht das Band,
                                       Das uns einander zugewandt;
                                       Und wollt' auch er, ich ließ ihn nicht entrinnen.

Ich hab' erforschet, wie es steht:
                                       Sein Schätzchen schwankt, ja kommet dir entgegen;
                                       Sie läßt ihn seiner Wege geh'n.

Arbeit' für meinen Konkurrenten;
                                       Vergess' mir etwas selbst zu spenden;
                                       Ersetze nur ein Spracherohr.

–
                                       Mit eis'gem Wort ich in sie dring';
                                       Sonst schmilzt noch hin das schwache Ding.

Blutschuld kann ertragen
                                       Wohl ich, der manche Seele schon getroffen;
                                       Doch euch würd' sie zu Boden schlagen.
